INSERT INTO `ora_top_sql` VALUES ('11655', '4', '6wm3n4d7bnddg', '246383688', ' SELECT source,        (case when time_secs < 1 then 1 else time_secs end) as time_secs,        operation  FROM   ( SELECT  1  as source,                 trunc((sysdate - cast(ll.log_date as date)) * 86400)                   as time_secs,                 decode(ll.operation,                        \'OPEN\',  0                        ,  1 ) as operation,                 ll.log_id as log_id          FROM  DBA_SCHEDULER_WINDOW_LOG ll ,                 ( SELECT max(l.log_id) as max_log_id                   FROM  DBA_SCHEDULER_WINDOW_LOG l ,                         DBA_SCHEDULER_WINGROUP_MEMBERS m                   WHERE  l.window_name = m.window_name                     AND  m.window_group_name = \'MAINTENANCE_WINDOW_GROUP\'                     AND  l.operation in (\'OPEN\', \'CLOSE\')                     AND  CAST(l.log_date AS DATE) < ( SELECT cast(min(end_interval_time) as date) as btime FROM  WRM$_SNAPSHOT bsi  WHERE  bsi.dbid = :dbid  AND bsi.instance_number = :inst  AND bsi.snap_id = :bid   ', '55', '0', '15479', '145', '393945', '7999', '649714', '120671', '113128', '0', '104', '1', '316', '3', '2016-04-14 14:31:13');
